import React from 'react';
import Sdata from './Sdata';
import Card from './Card';

const App = () => (
  <>
    <h1 className='heading'>Best Web Series</h1>

    <Card
      key={Sdata[0].id}
      simg={Sdata[1].simg}
      sname={Sdata.sname}
      stitle={Sdata.stitle}
      slink={Sdata.slink}
    />
  </>
);

export default App;
